//App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home/Home';
import CasualPage from './components/Casual/CasualPage';
import Portfolio from './components/Portfolio/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates/ResumeAndCertificates';
import AboutMe from './components/AboutMe/AboutMe';
import Contact from './components/Contact/Contact';
import Services from './components/Services/Services';
import Skills from './components/Skills/Skills';
import ProfessionalPage from './components/Professional/ProfessionalPage';
import LayoutWithNavbar from './components/LayoutWithNavbar';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <Home />
            </LayoutWithNavbar>
          }
        />
        {/* Casual routes */}
        <Route
          path="/casual/*"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <CasualPage />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/casual/ResumeAndCertificates/*"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <ResumeAndCertificates />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/casual/Portfolio/*"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <Portfolio />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/casual/AboutMe/*"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <AboutMe />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/casual/Contact/*"
          element={
            <LayoutWithNavbar isProfessional={false}>
              <Contact />
            </LayoutWithNavbar>
          }
        />

        {/* Professional routes */}
        <Route
          path="/professional/*"
          element={
            <LayoutWithNavbar isProfessional={true}>
              <ProfessionalPage />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/professional/Portfolio/*"
          element={
            <LayoutWithNavbar isProfessional={true}>
              <Portfolio />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/professional/Services/*"
          element={
            <LayoutWithNavbar isProfessional={true}>
              <Services />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/professional/Skills/*"
          element={
            <LayoutWithNavbar isProfessional={true}>
              <Skills />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/professional/Contact/*"
          element={
            <LayoutWithNavbar isProfessional={true}>
              <Contact />
            </LayoutWithNavbar>
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
